import React from "react";
import { Bar } from 'react-chartjs-2';
import { Chart, registerables } from 'chart.js';
Chart.register(...registerables);

const BarChart = () => {

    const data = {
        labels: ['1','2','3','4'],
        datasets:[
            {
            borderColor: 'rgba(35,200,153,1)',
            data: [100,120,50,110],
            lineTension: 0,
            }
        ]
        }

    return (
        <div className="chart">
            <Bar data={data} />
        </div>
    )
}

export default BarChart;
